SportsTables is a league table creation and management app for any kind of sport. 

It lets you create league tables for tournaments and keep track of the scores for games by simply:

- entering a name for your league table;
- setting how many points you get for a win or draw in that league;
- adding teams or individuals to the league;
- recording the scores of matches between those teams or individuals;
- sharing your table online with friends.

You might be at a sports tournament? Or gaming with friends?  And you need to make a league table. Whether it's Soccer, Rugby, Hockey, Basketball, Futsal, Football, real or virtual,  whatever really, chances are you could use SportsTables to compile the results of the competition and create a league table for you.

Its particularly useful for PES and FIFA or youth/school sports events.
